import { Dashboard } from "../AdminDashboard/admindashboard";
import './adminmasterapi.css'

const Master = () => {

    const adminMaster = () => {
        return (
            <>
                <div className="master">
                    <div className="row">
                        <table className="table">
                            <thead>
                                <th>Location</th>
                                <th>Action</th>
                            </thead>
                        </table>
                    </div>
                    <div className="">
                        <h3>Add locatiion</h3>
                    </div>
                </div>
            </>
        )
    }

    return (
        <>
            <Dashboard />
            {adminMaster()}
        </>
    )
}

export default Master;
